webpackJsonp([0x6013b14dc0c8],{434:function(a,n){a.exports={data:{markdownRemark:{html:'<p>Sejak dari awal berkuliah di Fasilkom, salah satu hal yang ingin saya wujudkan adalah magang di suatu perusahaan/start up sebagai software engineer. Magang sendiri merupakan kesempatan bagi mahasiswa yang ingin mencicipi rasanya kerja. Magang sebenarnya bukan suatu hal yang spesial karena Fasilkom sendiri mewajibkan mahasiswanya untuk magang pada semester akhir lebih tepatnya pada mata kuliah kerja praktek yang bernilai 3 SKS. Walau begitu, saya ingin mencoba magang lebih awal seperti pada tahun pertama karena banyak kakak tingkat saya juga melakukan hal yang sama <img class="emoji-icon" data-icon="emoji-stuck_out_tongue" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Tentu banyak alasan mengapa saya ingin magang lebih awal seperti <del>tidak ingin seharian nonton anime saat liburan</del> ingin mencoba belajar hal baru, mendapat pengalaman yang tidak didapat di kuliah, mendapat koneksi baru, memperkaya CV, dan hal-hal lain. Oh iya, magang di awal ini tidak dapat diajukan sebagai bagian dari mata kuliah kerja praktek sehingga kewajiban untuk mengambil mata kuliah ini pada semester akhir tidak gugur <img class="emoji-icon" data-icon="emoji-disappointed" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">.</p>\n<h2>Perjalanan Saya Mendapatkan Magang</h2>\n<p>Perjalanan saya di dunia permagangan dimulai saat Kak Nia berkunjung ke Fasilkom. Saat itu, Kak Nia bekerja di Dekoruma dan saya cukup familiar dengan namanya karena membaca <a href="https://medium.com/@albertusangga/freshman-software-engineering-internship-experience-at-stoqo-part-1-5a4dd7c8cffa">artikel Albert-kun</a> dan cukup banyak anak TOKI yang magang di sana karena ulahnya pada TOKI Camp ckck. Kak Nia beberapa kali berkunjung ke Fasilkom dan hebatnya pada saat itu kesempatan magang bagi mahasiswa tahun pertama tidak ada. PHP emang <img class="emoji-icon" data-icon="emoji-disappointed_relieved" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Usut punya usut, ternyata FwP dan Dhipta berhasil mendapatkan kesempatan magang di sana untuk liburan bulan Januari. Beberapa teman saya juga magang walaupun di tempat yang berbeda. Saya sendiri tidak tertarik untuk magang pada saat itu karena masih kaget dengan rutinitas kuliah dan ingin beristirahat sejenak (liburan).</p>\n<p>Pada saat memasuki semester 2, saya mulai memikirkan tentang magang. Jika sebelumnya saya tidak tertarik, liburan pada bulan juni nanti saya harus pastikan mendapat magang karena berlangsung sangat panjang, tiga bulan. Kalau tidak magang mau apa coba? <del>maraton anime?</del> Pilihan pertama saya jatuh ke Toko***** karena melihat Rey mendapat magang di sana. Setelah submit CV saya, akhirnya saya menunggu. 1 minggu berlalu, 2 minggu berlalu, hingga saya yakin saya tidak dapat.</p>\n<p>Di hari Kamis yang cerah pada pukul 2 setelah kelas MPKT A yang harusnya selesai pukul 3.30, saya pergi ke kantin. Sambil duduk di kantin menikmati teh hangat beserta roti bakar dengan keju, saya merenungi nasib saya yang belum mendapat magang itu. Tak lama kemudian, Indra datang sambil kaget karena menyadari ternyata dosennya tidak paling cepat dalam mengakhiri kelasnya.</p>\n<p>“Dra, lo nanti magang di mana?”</p>\n<blockquote>"Bizzy"</blockquote>\n<p>“Gimana daftarnya?”</p>\n<blockquote>"Chat aja Pak Norman di LinkedIn"</blockquote>\n<p>Saya sendiri sudah mengenal Pak Norman dari <a href="https://fairuzi10.github.io/blog/toki-camp-2018/">TOKI Camp yang lalu</a>. Langsung saja saya chat dan mendapat sambutan baik. Saya mengikuti alur pendaftaran magang yang terdiri dari tiga kali wawancara termasuk dengan Pak Norman. Pada akhirnya, saya akhirnya mendapat kesempatan magang di Bizzy yang jika dihitung-hitung dari mulai mendaftar memakan waktu sekitar sebulan.</p>\n<h2>Apa yang Saya Pelajari dari Pendaftaran Magang</h2>\n<p>Berikut ini merupakan hal yang saya sadari saat proses mendaftar magang.</p>\n<h4>Pelajari Struktur Data dan Algoritma</h4>\n<p>Nyaris semua perusahaan/startup yang saya tahu memiliki program internship yang oke memiliki seleksi koding. Biasanya, bahasa yang digunakan bebas karena yang diuji adalah pemahaman akan struktur data dan algoritma. Saya sendiri merasa mendapat kesempatan magang di Bizzy karena latar belakang TOKI saya yang berkaitan erat dengan ini.</p>\n<h4>Coba Buat Proyek Kodingmu</h4>\n<p>Membuat proyek ngoding cukup bermanfaat agar kamu tidak kaget saat magang yang kesehariannya diisi dengan ngoding seperti ini. Jika kamu sudah memiliki target tempatmu magang nanti, coba pelajari tech stack mereka. Jika tidak, coba saja gunakan apa pun yang menarik perhatianmu. Saya sendiri mencoba belajar Django dan React karena banyak website-website di Fasikom terutama buatan Ristek yang menggunakannya. Pada akhirnya, mungkin yang kamu tidak akan menggunakannya pada saat magang nanti namun setidaknya, kamu mengerti hal-hal dasar seperti Git, package manager, HTTP request, SQL, dll. Selain untuk belajar, proyek-proyek seperti ini dapat kamu masukkan ke CV saat kamu mendaftar nanti.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/side-project-24db894bf4754bc9e8e9ef0822271118-4946c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 540px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 97.22222222222223%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Proyek Ngoding Pribadi"\n        title=""\n        src="/static/side-project-24db894bf4754bc9e8e9ef0822271118-4946c.png"\n        srcset="/static/side-project-24db894bf4754bc9e8e9ef0822271118-ae4e1.png 163w,\n/static/side-project-24db894bf4754bc9e8e9ef0822271118-e0ba1.png 325w,\n/static/side-project-24db894bf4754bc9e8e9ef0822271118-4946c.png 540w"\n        sizes="(max-width: 540px) 100vw, 540px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h4>Jangan Menunda Mendaftar Magang</h4>\n<p>Ini adalah kesalahan saya yang utama. Saat itu, saya berpikir mungkin akan lebih baik jika saya mengerjakan beberapa proyek pribadi dan mendaftar Ristek terlebih dahulu untuk mengisi CV. Namun nyatanya, kesibukan lain membuat saya tidak mengerjakan proyek tersebut dan saya ditolak mentah-mentah oleh Ristek <img class="emoji-icon" data-icon="emoji-cry" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Untungnya, dengan berbekal CV yang sudah ada saya masih mendapat kesempatan magang namun dengan sedikit pilihan karena banyak tempat-tempat yang sudah penuh untuk magang. Bahkan, ada tempat yang memberikan kemudahan diterima bagi TOKI namun saya tidak dapat mendaftar karena keterlambatan saya. Singkatnya, mereka mencari N orang pertama yang OK, bukan N orang terbaik yang ingin mendaftar. Jadi, segeralah mendaftar jika kamu benar-benar berencana untuk magang. Sebagai patokan, mulailah mendaftar ketika semester dimulai jika kamu ingin magang pada liburan berikutnya. Selain memiliki banyak pilihan, kamu juga dapat bersantai dengan mendaftar di satu tempat dan baru mendaftar di tempat lain jika kamu positif ditolak, bukan dengan “menyebar CV” dengan persiapan setengah-setengah.</p>\n<h4>Cari Tempat yang Sesuai dengan Latar Belakang</h4>\n<p>Ketika mencari tempat magang, mungkin kamu perlu mempertimbangkan pandangan recruiter/CTO-nya untuk memperlancar kamu mendapat magang di sana. Sebagai contoh, ada beberapa tempat yang kurang menyukai mahasiswa tahun pertama. Akhirnya, saya sebagai mahasiswa tahun pertama memutuskan untuk tidak mendaftar di tempat tersebut dan mendaftar di Bizzy yang menjadi sponsor di acara TOKI dan tertarik untuk hire anak-anak TOKI. Bahkan, saya berani tidak mendaftar di tempat lain sebelum mendapat hasil dari Bizzy karena berpeluang besar diterima meskipun dengan resiko semua tempat lain sudah tutup jika saya ditolak. Contoh lain, mungkin kamu dapat mencari tempat-tempat yang memiliki preferensi kepada pegiat open source jika kamu suka berkontribusi pada proyek-proyek open source.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-4af1c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.22254758418741%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="gamble Shingeki no Kyojin"\n        title=""\n        src="/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-10273.png"\n        srcset="/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-9b14a.png 163w,\n/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-94962.png 325w,\n/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-10273.png 650w,\n/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-2fc6f.png 975w,\n/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-a8a2c.png 1300w,\n/static/gamble-a00cf1a3ebc922ce844c6dbd56c6efa9-4af1c.png 1366w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Ngewibu dulu dikit</em></p>\n<hr class="section-divider" />\n<p>Mempersiapkan magang pertama memang tidak mudah. Semoga tulisan ini dapat memberikan masukan baru bagimu dalam mempersiapkan magang. Tulisan mengenai pengalaman magang di Bizzy akan hadir segera! (ssstt, with tons of meme <img class="emoji-icon" data-icon="emoji-stuck_out_tongue" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">)</p>',frontmatter:{title:"Bagaimana Saya Mendapatkan Kesempatan Magang di Bizzy",date:"25 August 2018",description:"Perjalanan saya mendapatkan kesempatan magang sebagai software engineer yang pada akhirnya mengantarkan saya ke Bizzy."},fields:{slug:"/mendapatkan-magang-bizzy/"}}},pathContext:{slug:"/mendapatkan-magang-bizzy/"}}}});
